textOriginal:
O Problema principal está na falta de participação efetiva e consciente do povão,proletariado, no processo democrático; veja só a destruição que um Governo anti-social,sem projetos e minado de vigaristas como oque aí está pode ocasionar para um País, Brasil hoje tem até um ministro da economia que além de tirar o financiamento público de projetos sociais que foram implementados por governos passados e não regular o mercado deixando os preços dos produtos e serviços a mercê daqueles que só visam o lucro, ainda esconde descaradamente seu próprio dinheiro em paraíso fiscal pra não contribuir com o desenvolvimento do País; ficou mais doque  provado que o cenário político de uma nação pode se tornar calamitoso por conta de um voto errado, motivado por fake news, pois pode resultar na eleição de uma pessoa desqualificada como jair bolsonaro.
bolsonaro e seu governo destrambelhado principalmente na figura do sr. paulo guedes o "posto ipiranga", são a favor do chamado "livre mercado" e a fome desse livre mercado por lucros é insaciável;
Mercado sem regulação é sinônimo de exploração do trabalhador e preço abusivo dos produtos e serviços; por trás da onda de anti-política e da politicagem disfarçada de combate à corrupção que se dissemina para tentar tumultuar o debate político-democrático existem muitos interesses escusos, alguns em busca do poder e outros em busca de carta branca pra comprar mão de obra barata e lucrar muito comercializando produtos e serviços a preços exorbitantes; Proletário esteja por dentro do debate político,analise cada projeto,cada proposta e a trajetória política dos candidatos,e faça a escolha certa pra depois não lamentar; através da democracia você que é do povo pode escolher os seus representantes e assim construir um País melhor.
